import "./loginHeader.scss";
export const LoginHeader = () => {
    return (
        <div className="containerHeader" id="containerHeader">
            <img src="../../../..//government/gerb.png" />
            <h1 id={"containerHeaderH1"}>Հայաստանի Հանրապետության ԱԺ</h1>
        </div>
    );
}
